inputs.prompt:
# system:
You are an AI designed to assist with analyzing feedback and suggestions from a dataset obtained from the "mysqltutorial.MicrosoftFormTable". 
Your task involves performing sentiment analysis or topic modeling based on the command received.

# user:
Given the command "{{ command }}" and the data fetched from the last node {{sql_results}}, perform the required analysis. 
If the command is "feedback sentiment analysis", analyze the "Feedback" column to determine the sentiment of each entry (positive, negative, neutral). 
Please do not return any chain of thoughts, only one of the three entries. Please also summarize the results in terms of percentages. Please output the results strictly in the format "llmTask: feedback sentiment analysis; llmAnswers: "Total responses: N, Positive feedback: X%, Negative feedback: Y%, Neutral feedback: Z%".
If the command is "suggestion topic modeling", analyze the "Suggestion" column to categorize each entry into topics such as Course Logistics and Fit, 
Curriculum, Teaching Modality, Teaching, Resources, or any other appropriate topics. Please do not return any chain of thoughts. 
Please also summarize the results in terms of percentages. Please output the results strictly in the format "llmTask: suggestion topic modeling; llmAnswers: "Total responses: N, Course Logistics and Fit: X%, Curriculum: Y%, Teaching Modality: Z%, other topic: A% as appropriate".

# assistant:
{% if command == "feedback sentiment analysis" %}
  {% if sql_results.Feedbacks %}
    {% set feedbacks = sql_results.Feedbacks.split("|||") %}
    {% set total_feedbacks = feedbacks | length %}
    {% set positive = feedbacks | select('equalto', 'positive') | list | length %}
    {% set negative = feedbacks | select('equalto', 'negative') | list | length %}
    {% set neutral = total_feedbacks - positive - negative %}
    llmTask: Analyze sentiment; llmAnswers: "Positive feedback: {{ (positive / total_feedbacks * 100) | round(2) }}%, Negative feedback: {{ (negative / total_feedbacks * 100) | round(2) }}%, Neutral feedback: {{ (neutral / total_feedbacks * 100) | round(2) }}%"
  {% else %}
    llmTask: Analyze sentiment; llmAnswers: "Feedback section does not exist."
  {% endif %}
{% elif command == "suggestion topic modeling" %}
  {% if sql_results.Suggestions %}
    {% set suggestions = sql_results.Suggestions.split("|||") %}
    {% set total_suggestions = suggestions | length %}
    {% set topic_counts = {"Course Logistics and Fit": 0, "Curriculum": 0, "Teaching Modality": 0, "Teaching": 0, "Resources": 0, "Other": 0} %}
    {% for suggestion in suggestions %}
      {% set topic = "Other" %} {# Default to "Other" for simplicity #}
      {# Workaround for incrementing the count for the identified topic #}
      {% if topic %}
        {% set _ = topic_counts.update({topic: topic_counts[topic] + 1}) %}
      {% endif %}
    {% endfor %}
    llmTask: Categorize suggestions; llmAnswers: 
    "Course Logistics and Fit: {{ (topic_counts['Course Logistics and Fit'] / total_suggestions * 100) | round(2) }}%, Curriculum: {{ (topic_counts['Curriculum'] / total_suggestions * 100) | round(2) }}%, Teaching Modality: {{ (topic_counts['Teaching Modality'] / total_suggestions * 100) | round(2) }}%, Teaching: {{ (topic_counts['Teaching'] / total_suggestions * 100) | round(2) }}%, Resources: {{ (topic_counts['Resources'] / total_suggestions * 100) | round(2) }}%, Other: {{ (topic_counts['Other'] / total_suggestions * 100) | round(2) }}%"
  {% else %}
    llmTask: Categorize suggestions; llmAnswers: "Suggestion section does not exist."
  {% endif %}
{% else %}
  llmTask: ; llmAnswers: "Command not recognized."
{% endif %}
